Nature's Power Revealed

Nature Documentary hosted by Phillip Hurd Wood, published by Questar in 2011 - English narration


Information
------------------------------

Nature's Power Revealed
We can't control them, we can't accurately predict them, and they can produce some of our biggest tragedies, but nature's awesome powers have also shaped Earth, replenishing and renewing it every day. From the molten core of our planet to the protective embrace of our atmosphere and the water which supports all life, watch as we reveal nature's greatest powers.



6)  Natures Rage in Harms Way 
Welcome to the danger zone, where nature strikes again and again with unimaginable force. Experience the terrors that confront those who live and work in harm's way. You will meet a woman who survived being buried alive in an avalanche for five hours.

